import "./Home.css";
import Layout from "../../components/Layout/Layout.jsx";
import AOS from 'aos'
// import { useEffect, useState } from 'react'

const Home = ({user, handleLogout}) => {
  return (
    <Layout user={user} handleLogout={handleLogout}>
      <div className = "home-main-div">
      <div className="home-logo">
        <div className="rotate linear infinite">
          <img src="../../images/logo-big.png" alt="logo" className="home-album" />
          </div>
          <div className="carDisplay-header" data-aos="fade-right" data-aos-duration="800" data-aos-anchor-placement='center-bottom' data-aos-offset={window.innerWidth > 450 ? "150" : "300"} >
            <img src="../../images/title.png" alt="logo" className="home-vinylVault"
        />
          </div>
        </div>
        </div>
    </Layout>
  );
};

export default Home;
